INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (49, N'adidas Women''s Supernova CSH 7 Running Shoe', N'Now there are even more reasons to love this training favorite. An improved last, new step-in sockliner and the smooth control of 3-D ForMotion™ deliver a natural, balanced touchdown that feels better than ever.', N'<p>Built to take you far and fast, Adidas Supernova Cushion 7 road-running shoes offer incredible cushioning and comfort with low weight. * Abrasion-resistant nylon mesh uppers are lightweight and highly breathable; synthetic leather overlays create structure and support * GeoFit construction at ankles provides an anatomically correct fit and extra comfort * Nylon linings and molded, antimicrobial dual-layer EVA footbeds dry quickly and fight odor * adiPRENE® midsoles absorb shock in the heels and help maximize heel protection and stability * adiPRENE®+ under forefeet retains natural propulsive forces for improved efficiency * Torsion® system at the midfoot allows natural rotation between the rearfoot and the forefoot, helping improve surface adaptability * ForMotion® freely moving, decoupled heel system allows your feet to adapt to the ground strike and adjust for forward momentum * adiWEAR® rubber outsoles give ample durability in high-wear areas and offer lightweight grip and cushion Mens shoes , men''s shoes , running shoes , adidas shoes , adidas running shoes , mens running shoes , snova running shoes , snova mens adidas , snova adidas running , snova shoes , sport shoes mens , sport shoes adidas , mens shoes , men''s shoes , running , adidas</p>', N'', 4, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE20187F4F0 AS DateTime), CAST(0x00009D7F0083134E AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (50, N'etnies Men''s Digit Sneaker', N'This sleek shoe has all you need--from the padded tongue and collar and internal EVA midsole, to the STI Level 2 cushioning for impact absorption and stability.', N'Established in 1986, etnies is the first skateboarder-owned and skateboarder-operated global action sports footwear and apparel company. etnies not only pushed the envelope by creating the first pro model skate shoe, but it pioneered technological advances and changed the face of skateboard footwear forever. Today, etnies'' vision is to remain the leading action sports company committed to creating functional products that provide the most style, comfort, durability and protection possible. etnies stays true to its roots by sponsoring a world-class team of skateboarding, surfing, snowboarding, moto-x, and BMX athletes and continues its dedication by giving back to each of these communities.', N'', 4, 1, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE201890539 AS DateTime), CAST(0x00009D7F008315F6 AS DateTime))
