INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (56, N'Ray Ban Aviator Sunglasses RB 3025', N'Aviator sunglasses are one of the first widely popularized styles of modern day sunwear.', N'<p>Since 1937, Ray-Ban can genuinely claim the title as the world''s leading sunglasses and optical eyewear brand. Combining the best of fashion and sports performance, the Ray-Ban line of Sunglasses delivers a truly classic style that will have you looking great today and for years to come.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE3000A7567 AS DateTime), CAST(0x00009D7F00833859 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (57, N'Genuine Leather Handbag with Cell Phone Holder & Many Pockets', N'Classic Leather Handbag', N'<p>This fine leather handbag will quickly become your favorite bag. It has a zipper organizer on the front that includes a notepad pocket, pen holder, credit card slots and zipper pocket divider. On top of this is a zipper pocket and another flap closure pocket. The main compartment is fully lined and includes a side zipper pocket. On the back is another zipper pocket. And don''t forget the convenient built in cell phone holder on the side! The long strap is fully adjustable so you can wear it crossbody or over the shoulder. This is a very well-made, quality leather bag that is not too big, but not too small.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE3000B03E3 AS DateTime), CAST(0x00009D7F00832F07 AS DateTime))
