INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (60, N'The Best Skillet Recipes', N'What''s the Best Way to Make Lasagna With Rich, Meaty Flavor, Chunks of Tomato, and Gooey Cheese, Without Ever Turning on the Oven or Boiling a Pot of (Hardcover)', N'<p>In this latest addition of the Best Recipe Classic series, <i>Cooks Illustrated</i> editor Christopher Kimball and his team of kitchen scientists celebrate the untold versatility of that ordinary workhorse, the 12-inch skillet. An indispensable tool for eggs, pan-seared meats and sautéed vegetables, the skillet can also be used for stovetop-to-oven dishes such as All-American Mini Meatloaves; layered dishes such as tamale pie and Tuscan bean casserole; and even desserts such as hot fudge pudding cake. In the trademark style of other America''s Test Kitchen publications, the cookbook contains plenty of variations on basic themes (you can make chicken and rice with peas and scallions, broccoli and cheddar, or coconut milk and pistachios); ingredient and equipment roundups; and helpful illustrations for preparing mango and stringing snowpeas. Yet the true strength of the series lies in the sheer thoughtfulness and detail of the recipes. Whether or not you properly appreciate your skillet, this book will at least teach you to wield it gracefully. <i>(Mar.)</i>   <br />
 Copyright © Reed Business Information, a division of Reed Elsevier Inc. All rights reserved.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300B59FD8 AS DateTime), CAST(0x00009D7F00807D78 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (61, N'Cooking for Two', N'More Than 200 Foolproof Recipes for Weeknights and Special Occasions (Hardcover)', N'<p>Hardcover: 352 pages<br />
  Publisher: America''s Test Kitchen (May 2009)<br />
  Language: English<br />
  ISBN-10: 1933615435<br />
  ISBN-13: 978-1933615431</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300B83182 AS DateTime), CAST(0x00009D7F0080BC0E AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (62, N'EatingWell in Season', N'A Farmers'' Market Cookbook (Hardcover)', N'<p><span class="plogBodyText">Trying to get big chocolate flavor into a crisp holiday cookie is no easy feat. Any decent baker can get a soft, chewy cookie to scream “chocolate,” but a dough that can withstand a rolling pin and cookie cutters simply can’t be too soft. Most chocolate butter cookies skimp on the gooey chocolate and their chocolate flavor is quite modest. </span></p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300B90A94 AS DateTime), CAST(0x00009D7F0080CF51 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (63, N'Best Grilling Recipes', N'More Than 100 Regional Favorites Tested and Perfected for the Outdoor Cook (Hardcover)', N'<p>Take a winding cross-country trip and you''ll discover barbecue shacks with offerings like tender-smoky Baltimore pit beef and saucy St. Louis pork steaks. To bring you the best of these hidden gems, along with all the classics, the editors of Cook''s Country magazine scoured the country, then tested and perfected their favorites. HEre traditions large and small are brought into the backyard, from Hawaii''s rotisserie favorite, the golden-hued Huli Huli Chicken, to fall-off-the-bone Chicago Barbecued Ribs. In Kansas City, they''re all about the sauce, and for our saucy Kansas City Sticky Ribs, we found a surprise ingredient-root beer. We also tackle all the best sides. <br />
<br />
   Not sure where or how to start? This cookbook kicks off with an easy-to-follow primer that will get newcomers all fired up. Whether you want to entertain a crowd or just want to learn to make perfect burgers, Best Grilling Recipes shows you the way.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300BA0570 AS DateTime), CAST(0x00009D7F0080C9B7 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (64, N'HP IQ506 TouchSmart Desktop PC', N'', N'<p>Redesigned with a next-generation, touch-enabled 22-inch high-definition LCD screen, the HP TouchSmart IQ506 all-in-one desktop PC is designed to fit wherever life happens: in the kitchen, family room, or living room. With one touch you can check the weather, download your e-mail, or watch your favorite TV show. It''s also designed to maximize energy, with a power-saving Intel Core 2 Duo processor and advanced power management technology, as well as material efficiency--right down to the packaging. It has a sleek piano black design with elegant espresso side-panel highlights, and the HP Ambient Light lets you set a mood--or see your keyboard in the dark.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300C1CAD5 AS DateTime), CAST(0x00009D7F00812D24 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (65, N'HP Pavilion Elite M9150F Desktop PC', N'Top-of-the-line multimedia desktop featuring 2.4 GHz Intel Core 2 Quad Processor Q6600 with four lightning fast execution cores', N'<p>The updated chassis with sleek piano black paneling and components is far from the most significant improvements in the multimedia powerhouse HP Pavilion Elite m9150f desktop PC. It''s powered by Intel''s newest processor--the 2.4 GHz Intel Core 2 Quad Q6600--which delivers four complete execution cores within a single processor for unprecedented performance and responsiveness in multi-threaded and multi-tasking business/home environments. You can also go wireless and clutter-free with wireless keyboard, mouse, and remote control, and it includes the next step in Wi-Fi networking with a 54g wireless LAN (802.11b/g).</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300C23D02 AS DateTime), CAST(0x00009D7F00812B96 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (66, N'Compaq Presario SR1519X Pentium 4 Desktop PC with CDRW', N'Hewlett Packard Desktop PC', N'<p>Compaq Presario PCs give you solid performance, ease of use, and deliver just what you need so you can do more with less effort. Whether you are e-mailing family, balancing your online checkbook or creating school projects, the Presario is the right PC for you.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300C344E1 AS DateTime), CAST(0x00009D7F00812F15 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (67, N'Build your own computer', N'Build it', N'<p>Fight back against cluttered workspaces with the stylish Sony VAIO JS All-in-One desktop PC, featuring powerful computing resources and a stunning 20.1-inch widescreen display with stunning XBRITE-HiColor LCD technology. The silver Sony VAIO VGC-JS110J/S has a built-in microphone and MOTION EYE camera with face-tracking technology that allows for easy communication with friends and family. And it has a built-in DVD burner and Sony''s Movie Store software so you can create a digital entertainment library for personal viewing at your convenience. Easy to setup and even easier to use, this JS-series All-in-One includes an elegantly designed keyboard and a USB mouse.</p>', N'', 4, 1, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300C42DDD AS DateTime), CAST(0x00009D7F008130AD AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (68, N'ASUS Eee PC 900HA 8.9-Inch Netbook Black', N'High Speed Connectivity Anywhere with Wi-Fi 802.11b/g.', N'<p>Much more compact than a standard-sized notebook and weighing just 2.5 pounds, the Eee PC 900HA is perfect for students toting to school or road warriors packing away to Wi-Fi hotspots. In addition to the 160 GB hard disk drive (HDD), the Eee PC 900HA also features 1 GB of RAM, VGA-resolution webcam integrated into the bezel above the LCD, 54g Wi-Fi networking (802.11b/g), multiple USB ports, SD memory card slot, a VGA output for connecting to a monitor, and up to 10 GB of online storage (complimentary for 18 months).</p>
<p>It comes preinstalled with the Microsoft Windows XP Home operating system, which offers more experienced users an enhanced and innovative experience that incorporates Windows Live features like Windows Live Messenger for instant messaging and Windows Live Mail for consolidated email accounts on your desktop. Complementing this is Microsoft Works, which equips the user with numerous office applications to work efficiently.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300CB3CF9 AS DateTime), CAST(0x00009E3100A06392 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (69, N'Toshiba Satellite A305-S6908 15.4-Inch Laptop', N'Stylish, highly versatile laptop with 15.4-inch LCD, webcam integrated into bezel, and high-gloss finish', N'<p>It''s powered by the 2.0 GHz Intel Core 2 Duo T6400 processor, which boosts speed, reduces power requirements, and saves on battery life. It also offers a fast 800 MHz front-side bus speed and 2 MB L2 cache. It also includes Intel''s 5100AGN wireless LAN, which will connect to draft 802.11n routers and offers compatibility with 802.11a/b/g networks as well. Other features include an enormous 250 GB hard drive,&nbsp;1 GB of installed RAM (max capacity), dual-layer DVD±RW burner (with Labelflash disc printing), ExpressCard 54/34 slot, a combo USB/eSATA port, SPDIF digital audio output for surround sound, and a 5-in-1 memory card adapter.</p>
<p>This PC comes preinstalled with the 64-bit version of Microsoft Windows Vista Home Premium (SP1), which includes all of the Windows Media Center capabilities for turning your PC into an all-in-one home entertainment center. In addition to easily playing your DVD movies and managing your digital audio library, you''ll be able to record and watch your favorite TV shows (even HDTV). Vista also integrates new search tools throughout the operating system, includes new parental control features, and offers new tools that can warn you of impending hardware failures</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300CBB68D AS DateTime), CAST(0x00009D7F0081AF09 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (70, N'ASUS Eee PC 1000HA 10-Inch Netbook', N'Super Hybrid Engine offers a choice of performance and power consumption modes for easy adjustments according to various needs', N'<p>Much more compact than a standard-sized notebook and weighing just over 3 pounds, the Eee PC 1000HA is perfect for students toting to school or road warriors packing away to Wi-Fi hotspots. The Eee PC 1000HA also features a 160 GB hard disk drive (HDD), 1 GB of RAM, 1.3-megapixel webcam integrated into the bezel above the LCD, 54g Wi-Fi networking (802.11b/g), Secure Digital memory card slot, multiple USB ports, a VGA output for connecting to a monitor.</p>
<p>It comes preinstalled with the Microsoft Windows XP Home operating system, which offers more experienced users an enhanced and innovative experience that incorporates Windows Live features like Windows Live Messenger for instant messaging and Windows Live Mail for consolidated email accounts on your desktop. Complementing this is Microsoft Works, which equips the user with numerous office applications to work efficiently.</p>
<p>The new Eee PC 1000HA has a customized, cutting-edge Infusion casing technology in Fine Ebony. Inlaid within the chassis itself, the motifs are an integral part of the entire cover and will not fade with time. The Infusion surface also provides a new level of resilience, providing scratch resistance and a beautiful style while out and about.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300CC482F AS DateTime), CAST(0x00009E3100A035AF AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (71, N'HP Pavilion G60-230US 16.0-Inch Laptop', N'Streamlined multimedia laptop with 16-inch screen for basic computing, entertainment and online communication', N'<p>Chat face to face, or take pictures and video clips with the webcam and integrated digital microphone. Play games and enhance multimedia with the Intel GMA 4500M with up to 1309 MB of total available graphics memory. And enjoy movies or music in seconds with the external DVD or music buttons to launch HP QuickPlay (which bypasses the boot process).  It offers dual-core productivity from its 2.0 GHz Intel Pentium T4200 processor for excellent multitasking. Other features include a 320 GB hard drive, 3 GB of installed RAM (4 GB maximum capacity), dual-layer DVD±RW drive (which also burns CDs), quad-mode Wi-Fi (802.11a/b/g/n), 5-in-1 memory card reader, and pre-installed Windows Vista Home Premium (SP1).</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300CCA3C1 AS DateTime), CAST(0x00009D7F0081AC87 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (72, N'HP Pavilion Artist Edition DV2890NR 14.1-inch Laptop', N'Unique Asian-influenced HP imprint wraps the laptop both inside and out', N'<p>Optimize your mobility with a BrightView 14.1-inch display that has the same viewable area as a 15.4-inch screen--in a notebook that weighs a pound less. Encouraging more direct interaction, the backlit media control panel responds to the touch or sweep of a finger. Control settings for audio and video playback from up to 10 feet away with the included HP remote, then store it conveniently in the PC card slot. Enjoy movies or music in seconds with the external DVD or music buttons to launch HP QuickPlay (which bypasses the boot process).</p>
<p>It''s powered by the 1.83 GHz Intel Core 2 Duo T5550 processor, which provides an optimized, multithreaded architecture for improved gaming and multitasking performance, as well as excellent battery management. It also includes Intel''s 4965 AGN wireless LAN, which will connect to draft 802.11n routers and offers compatibility with 802.11a/b/g networks as well. It also features a 250 GB hard drive, 3 GB of installed RAM (4 GB maximum), LighScribe dual-layer DVD±R burner, HDMI port for connecting to an HDTV, and Nvidia GeForce Go 8400M GS video/graphics card with up to 1407 MB of total allocated video memory (128 MB dedicated). It also includes an integrated Webcam in the LCD''s bezel and an omnidirectional microphone for easy video chats.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300CDDF7F AS DateTime), CAST(0x00009D7F0081A9A2 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (73, N'Acer Aspire One 8.9" Mini-Notebook Case - (Black)', N'its Acer Aspire One 8.9" Mini-Notebook and 6 Cell Battery model (AOA150-1447)', N'<p>Acer Aspire One 8.9&quot; Memory Foam Pouch is the perfect fit for Acer Aspire One 8.9&quot;. This pouch is made out of premium quality shock absorbing memory form and it provides extra protection even though case is very light and slim. This pouch is water resistant and has internal supporting bands for Acer Aspire One 8.9&quot;. Made In Korea.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300D70E19 AS DateTime), CAST(0x00009D7F0081DE7F AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (74, N'Kensington 33117 International All-in-One Travel Plug Adapter', N'Includes plug adapters for use in more than 150 countries', N'<p>The Kensington 33117 Travel Plug Adapter is a pocket-sized power adapter for go-anywhere convenience. This all-in-one unit provides plug adapters for use in more than 150 countries, so you never need to be at a loss for power again. The Kensington 33117 is easy to use, with slide-out power plugs that ensure you won''t lose any vital pieces, in a compact, self-contained unit that eliminates any hassles. This all-in-one plug adapts power outlets for laptops, chargers, and similar devices, and features a safety release button and built-in fuse to ensure safe operation. The Kensington 33117 does not reduce or convert electrical voltage, is suitable for most consumer electronics ranging from 110-volts to Mac 275-watts, to 220-volts to Mac 550-watts. Backed by Kensington''s one-year warranty, this unit weighs 0.5, and measures 1.875 x 2 x 2.25 inches (WxDxH). Please note that this adapter is not designed for use with high-watt devices such as hairdryers and irons, so users should check electronic device specifications before using.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300D78BB1 AS DateTime), CAST(0x00009D7F0081E3DD AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (75, N'APC Back-UPS RS 800VA - UPS - 800 VA - UPS battery - lead acid ( BR800BLK )', N'APC Back-UPS RS, 800VA/540W, Input 120V/Output 120V, Interface Port USB. ', N'<p>The Back-UPS RS offers high performance protection for your business and office computer systems. It provides abundant battery backup power, allowing you to work through medium and extended length power outages. It also safeguards your equipment from damaging surges and spikes that travel along utility, phone and network lines. A distinguishing feature of the Back-UPS RS is automatic voltage regulation (AVR). AVR instantly adjusts both low and high voltages to safe levels, so you can work indefinitely during brownouts and overvoltage situations, saving the battery for power outages when you need it most. Award-winning shutdown software automatically powers down your computer system in the event of an extended power outage.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300D80115 AS DateTime), CAST(0x00009D7F0081E0BB AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (76, N'World of Warcraft: Wrath of the Lich King Expansion Pack', N'This expansion pack REQUIRES the original World of Warcraft game in order to run', N'<p>Fans of World of Warcraft, prepare for Blizzard Entertainment''s next installment -- World of Warcraft: Wrath of King Lich. In this latest expansion, something is afoot in the cold, harsh northlands. The Lich King Arthas has set in motion events that could lead to the extinction of all life on Azeroth. The necromantic power of the plague and legions of undead armies threaten to sweep across the land. Only the mightiest heroes can oppose the Lich King and end his reign of terror.</p>
<p>This expansion adds a host of content to the already massive existing game world. Players will achieve soaring levels of power, explore Northrend (the vast icy continent of the Lich King), and battle high-level heroes to determine the ultimate fate of Azeroth. As you face the dangers of the frigid, harsh north, prepare to master the dark necromantic powers of the Death Night -- World of Warcraft''s first Hero class. No longer servants of the Lich King, the Death Knights begin their new calling as experienced, formidable adversaries. Each is heavily armed, armored, and in possession of a deadly arsenal of forbidden magic.</p>
<p>If you have a World of Warcraft account with a character of at least level 55, you will be able to create a new level-55 Death Knight of any race (if on a PvP realm, the Death Knight must be the same faction as your existing character). And upon entering the new world, your Death Knight will begin to quest to level 80, gaining potent new abilities and talents along the way. This expansion allows for only one Death Knight per realm, per account.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300DCF8F7 AS DateTime), CAST(0x00009D7F00820700 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (77, N'Major League Baseball 2K9', N'Take charge of your franchise and enjoy the all-new MLB.com presentation style', N'<p>Major League Baseball 2K9 captures the essence of baseball down to some of the most minute, player- specific details including batting stances, pitching windups and signature swings. 2K Sports has gone above and beyond the call of duty to deliver this in true major league fashion. Additionally, gameplay enhancements in pitching, batting, fielding and base running promise this year''s installment to be user-friendly and enjoyable for rookies or veterans. New commentary and presentation provide the icing to this ultimate baseball experience. If you really want to Play Ball this is the game for you.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300DE29B6 AS DateTime), CAST(0x00009E3100A0D336 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (78, N'World Wide Soccer Manager 2009', N'Worldwide Soccer Manager 2009 from Sega for the PC or Mac is an in-depth soccer management game', N'<p>Worldwide Soccer Manager 2009 from Sega for the PC or Mac is an in-depth soccer management game. At the helm, you''ll enter the new season with a wide array of all-new features. The most impressive update is the first-time-ever, real-time 3D match engine with motion captured animations. With over 5,000 playable teams and every management decision in the palm of your hand, you''ll love watching your matches and decisions unfold from multiple camera angles as you compete in leagues around the world and major international tournaments.</p>
<p>Watch your match in real-time, or use the Match Time Bar to fast-forward through sluggish minutes or rewind key moments in the game. With this customization at your fingertips you can also choose the information you''d like to see during the match, such as latest scores or player performance stats for the match.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300DF2B54 AS DateTime), CAST(0x00009E3100A0DD69 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (79, N'Adobe Photoshop Elements 7', N'Easily find and view all your photos', N'<p>Adobe Photoshop Elements 7 software combines power and simplicity so you can make ordinary photos extraordinary; tell engaging stories in beautiful, personalized creations for print and web; and easily find and view all your photos. New Photoshop.com membership* works with Photoshop Elements so you can protect your photos with automatic online backup and 2 GB of storage; view your photos anywhere you are; and share your photos in fun, interactive ways with invitation-only Online Albums.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300E6ED70 AS DateTime), CAST(0x00009E3100A0F6A9 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (80, N'Corel Paint Shop Pro Photo X2', N'The ideal choice for any aspiring photographer''s digital darkroom', N'<p>orel Paint Shop Pro Photo X2 is the ideal choice for any aspiring photographer''s digital darkroom. Fix brightness, color, and photo flaws in a few clicks; use precision editing tools to create the picture you want; give photos a unique, exciting look using hundreds of special effects, and much more! Plus, the NEW one-of-a-kind Express Lab helps you quickly view and fix dozens of photos in the time it used to take to edit a few. Paint Shop Pro Photo X2 even includes a built-in Learning Center to help you get started, it''s the easiest way to get professional-looking photos - fast!</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300E799AD AS DateTime), CAST(0x00009E3100A10299 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (81, N'Samsung Rugby A837 Phone, Black (AT&T)', N'Ruggedized 3G handset in black great for outdoor workforces', N'<p>Ideal for on-site field services, the ruggedized Samsung Rugby for AT&amp;T can take just about anything you can throw at it. This highly durable handset is certified to Military Standard MIL-STD 810F standards that''s perfect for users like construction foremen and landscape designers. In addition to access to AT&amp;T Navigation turn-by-turn direction service, the Rugby also features compatibility with Push to Talk communication, Enterprise Paging, and AT&amp;T''s breakthrough Video Share calling services. This quad-band GSM phone runs on AT&amp;T''s dual-band 3G (HSDPA/UMTS) network, for fast downloads and seamless video calls. It also offers a 1.3-megapixel camera, microSD memory expansion to 8 GB, Bluetooth for handsfree communication and stereo music streaming, access to personal email and instant messaging, and up to 5 hours of talk time.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300ED4B43 AS DateTime), CAST(0x00009E3100A2DF21 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (82, N'BlackBerry Bold 9000 Phone, Black (AT&T)', N'lobal Blackberry messaging smartphone with quad-band GSM', N'<p>Keep yourself on track for your next meeting with turn-by-turn directions via the AT&amp;T Navigator service, which is powered by TeleNav and provides spoken or text-based turn-by-turn directions with automatic missed turn rerouting and a local business finder service in 20 countries. It also supports AT&amp;T mobile music services and access to thousands of video clips via Cellular Video. Other features include a 2-megapixel camera/camcorder, Bluetooth for handsfree communication, 1 GB of internal memory with MicroSD expansion (up to 32 GB), multi-format audio/video playback, and up to 4.5 hours of talk time.</p>
<p>The Blackberry Bold also comes with free access to AT&amp;T Wi-Fi Hotspots, available at more than 17,000 locations nationwide including Starbucks. The best part is that you do''nt need to sign up for anything new to use this service--Wi-Fi access for is included in all Blackberry Personal and Enterprise Rate Plans. (You must subscribe to a Blackberry Data Rate Plan to access AT&amp;T Wi-Fi Hotspots.) Additionally, the Blackberry Bold is the first RIM device that supports AT&amp;T Cellular Video (CV).</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300EE3781 AS DateTime), CAST(0x00009E3100A2E988 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (83, N'Canon VIXIA HF100 Camcorder', N'12x optical zoom; SuperRange Optical Image Stabilizer', N'<p>From Canon''s long history of optical excellence, advanced image processing, superb performance and technological innovation in photographic and broadcast television cameras comes the latest in high definition camcorders. <br />
<br />
  Now, with the light, compact Canon VIXIA HF100, you can have stunning AVCHD (Advanced Video Codec High Definition) format recording with the ease and numerous benefits of Flash Memory. It''s used in some of the world''s most innovative electronic products such as laptop computers, MP3 players, PDAs and cell phones. <br />
<br />
  Add to that the VIXIA HF100''s Canon Exclusive features such as our own 3.3 Megapixel Full HD CMOS sensor and advanced DIGIC DV II Image Processor, SuperRange Optical Image Stabilization, Instant Auto Focus, our 2.7-inch Widescreen Multi-Angle Vivid LCD and the Genuine Canon 12x HD video zoom lens and you have a Flash Memory camcorder that''s hard to beat.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300EFF7CD AS DateTime), CAST(0x00009D7F00826A01 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (84, N'Sony DCR-SR85 1MP 60GB Hard Drive Handycam Camcorder', N'Capture video to hard disk drive; 60 GB storage', N'<p>You’ll never miss a moment because of switching tapes or discs with the DCR-SR85. Its built-in 60GB hard disk drive offers plenty of storage as you zero in on your subjects with the professional-quality Carl Zeiss Vario-Tessar lens and a powerful 25x optical/2000x digital zoom. Compose shots using the 2.7-inch wide (16:9) touch-panel LCD display, and maintain total control and clarity with the Super SteadyShot image stabilization system. Hybrid recording technology even gives you the choice to record video to either the internal hard disk drive or removable Memory Stick Pro Duo media.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300F06FAD AS DateTime), CAST(0x00009D7F0082681A AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (85, N'Canon Digital Rebel XSi 12.2 MP Digital SLR Camera', N'12.2-megapixel CMOS sensor captures enough detail for poster-size, photo-quality prints', N'<p>For stunning photography with point and shoot ease, look no further than Canon&rsquo;s EOS Rebel XSi. The EOS Rebel XSi brings staggering technological innovation to the masses. It features Canon&rsquo;s EOS Integrated Cleaning System, Live View Function, a powerful DIGIC III Image Processor, plus a new 12.2-megapixel CMOS sensor and is available in a kit with the new EF-S 18-55mm f/3.5-5.6 IS lens with Optical Image Stabilizer. The EOS Rebel XSi&rsquo;s refined, ergonomic design includes a new 3.0-inch LCD monitor, compatibility with SD and SDHC memory cards and new accessories that enhance every aspect of the photographic experience.</p>', N'', 4, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009BE300F163C5 AS DateTime), CAST(0x00009E3100A126BE AS DateTime))
