INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (93, N'Panasonic HDC-SDT750K, High Definition 3D Camcorder', N'World''s first 3D Shooting Camcorder', N'<p>Unlike previous 3D images that required complex, professional equipment to create, now you can shoot your own. Simply attach the 3D Conversion Lens to the SDT750 for quick and easy 3D shooting. And because the SDT750 features the Advanced 3MOS System, which has gained worldwide popularity, colors are vivid and 3D images are extremely realistic. Let the SDT750 save precious moments for you in true-to-life images.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009E3100A63674 AS DateTime), CAST(0x00009E3100A636B1 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (94, N'Microsoft Bluetooth Notebook Mouse 5000 Mac/Windows', N'Enjoy reliable, transceiver-free wireless connection to your PC with Bluetooth Technology', N'<p>Enjoy wireless freedom with the Microsoft&reg; Bluetooth&reg; Notebook Mouse 5000 &mdash; no transceiver to connect or lose! Keep USB ports free for other devices. And, take it with you in a convenient carrying case (included)</p>', N'', 4, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009E3100A6BCF6 AS DateTime), CAST(0x00009E3100A6BD33 AS DateTime))
INSERT [dbo].[Nop_Product] ([ProductId], [Name], [ShortDescription], [FullDescription], [AdminComment], [TemplateID], [ShowOnHomePage], [MetaKeywords], [MetaDescription], [MetaTitle], [SEName], [AllowCustomerReviews], [AllowCustomerRatings], [RatingSum], [TotalRatingVotes], [Published], [Deleted], [CreatedOn], [UpdatedOn]) VALUES (95, N'Medal of Honor - Limited Edition (Xbox 360)', N'One of the great pioneers in military simulations returns to gaming as the Medal of Honor series depicts modern warfare for the first time, with a harrowing tour of duty in current day Afghanistan.', N'<p>You''ll take control of both ordinary U.S. Army Rangers and Tier 1 Elite Ops Special Forces as you fight enemy insurgents in the most dangerous theatre of war of the modern age. The intense first person combat has been created with input from U.S. military consultants and based on real-life descriptions from veteran soldiers. This allows you to use genuine military tactics and advanced technology including combat drones and targeted air strikes.</p>', N'', 5, 0, N'', N'', N'', N'', 1, 1, 0, 0, 1, 0, CAST(0x00009E3100A78108 AS DateTime), CAST(0x00009E3100A7996C AS DateTime))
